import React, { useState } from "react";
import { useQuery, useMutation, useQueryClient } from "react-query";
import { Link } from "react-router-dom";
import axios from "axios";

const fetchIngredients = async () => {
  const { data } = await axios.get("http://127.0.0.1:8000/ingredients");
  return data.ingredients;
};

function IngredientList({ searchQuery }) {
  const queryClient = useQueryClient();
  const { data: ingredients, error, isLoading } = useQuery("ingredients", fetchIngredients);
  
  const [quantityInput, setQuantityInput] = useState({}); // Stores user input for quantity change

  const updateStock = async (barcode, amount) => {
    if (!amount || amount <= 0) return;
    
    try {
      await axios.patch(`http://127.0.0.1:8000/increase/${barcode}`, { amount });
      queryClient.invalidateQueries("ingredients");
    } catch (error) {
      console.error("Error updating stock:", error);
    }
  };

  const decreaseStock = async (barcode, amount) => {
    if (!amount || amount <= 0) return;
    
    try {
      await axios.patch(`http://127.0.0.1:8000/decrease/${barcode}`, { amount });
      queryClient.invalidateQueries("ingredients");
    } catch (error) {
      console.error("Error updating stock:", error);
    }
  };

  if (isLoading) return <p>Loading ingredients...</p>;
  if (error) return <p>Error fetching ingredients</p>;

  return (
    <table className="table-auto w-full border-collapse border border-gray-300">
      <thead>
        <tr className="bg-gray-200">
          <th className="border px-4 py-2">Name</th>
          <th className="border px-4 py-2">Quantity</th>
          <th className="border px-4 py-2">Container</th>
          <th className="border px-4 py-2">Storage Location</th>
          <th className="border px-4 py-2">Actions</th>
          <th className="border px-4 py-2">Edit</th>
        </tr>
      </thead>
      <tbody>
        {ingredients
          .filter((ingredient) => ingredient.ingredient_name.toLowerCase().includes(searchQuery.toLowerCase()))
          .map((ingredient) => (
            <tr key={ingredient.barcode} className="text-center">
              <td className="border px-4 py-2">{ingredient.ingredient_name}</td>
              <td className="border px-4 py-2">{ingredient.num_containers}</td>
              <td className="border px-4 py-2">{ingredient.container_type}</td>
              <td className="border px-4 py-2">{ingredient.storage_location}</td>
              <td className="border px-4 py-2 flex justify-center items-center gap-2">
                <input
                  type="number"
                  className="border w-16 text-center"
                  value={quantityInput[ingredient.barcode] || ""}
                  onChange={(e) =>
                    setQuantityInput({ ...quantityInput, [ingredient.barcode]: e.target.value })
                  }
                  placeholder="Qty"
                />
                <button
                  className="bg-blue-500 text-white px-2 py-1 rounded"
                  onClick={() => updateStock(ingredient.barcode, Number(quantityInput[ingredient.barcode]))}
                >
                  ➕
                </button>
                <button
                  className="bg-red-500 text-white px-2 py-1 rounded"
                  onClick={() => decreaseStock(ingredient.barcode, Number(quantityInput[ingredient.barcode]))}
                >
                  ➖
                </button>
              </td>
              <td className="border px-4 py-2">
                <Link to={`/ingredient/${ingredient.barcode}`} className="text-blue-500 underline">
                  Edit
                </Link>
              </td>
            </tr>
          ))}
      </tbody>
    </table>
  );
}

export default IngredientList;
